import { useState } from "react";

// CHILD
function NavBar() {
  const possibleWinners = [
    {
      id: 1,
      name: "John",
      age: 20,
    },
    {
      id: 2,
      name: "Jane",
      age: 21,
    },
    {
      id: 3,
      name: "Joe",
      age: 22,
    },
  ];

  const [winner, setWinner] = useState(possibleWinners[0]);

  function handleClick() {
    setWinner(possibleWinners[1]);
  }

  return (
    <div>
      <h1>Name: {winner.name}</h1>

      <button onClick={handleClick}>Click</button>
    </div>
  );
}

export default NavBar;
